"       Clifton O Bingham, III, MD",
"      </a>",
"     </td>",
"     <td>",
"      <a class=\"contributor contributor_credentials patTopicContributorsType\" href=\"UTD.htm?2/45/2772/contributors\">",
"       Section Editor",
"      </a>",
