"        <strong>",
"         Practice",
"        </strong>",
"        (work monthly with the training devices)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Carry",
"        </strong>",
"        (take the self-injectable epinephrine everywhere and at all times)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Educate/Notify",
"        </strong>",
"        (inform family members, care givers, food providers)",
"       </td>",
"      </tr>",
