var title_f2_45_2780="Chemo regimens brain tumors";
var content_f2_45_2780=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F57806&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F57806&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Chemotherapy regimens used for high grade astrocytoma",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Carmustine",
"       </td>",
"       <td>",
"        150 to 200 mg/m2 day 1",
"       </td>",
"       <td>",
"        Every 6 weeks",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\" rowspan=\"3\">",
"        PCV [1]",
"       </td>",
"       <td>",
"        Procarbazine 100 mg/m2 days 1 to 10",
"       </td>",
"       <td colspan=\"1\" rowspan=\"3\">",
"        Every 6 to 8 weeks",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Lomustine 100 mg/m2",
"day 1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vincristine 1.5 mg/m2 (maximum 2 mg) day 1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\" rowspan=\"3\">",
"        PCV [2, 3]",
"       </td>",
"       <td>",
"        Procarbazine 60 mg/m2 days 8 to 21",
"       </td>",
"       <td colspan=\"1\" rowspan=\"3\">",
"        Every 6 to 8 weeks",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Lomustine 100 mg/m2",
"day 1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vincristine 1.5 mg/m2 (maximum 2 mg) days 8 and 29",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Temozolomide",
"       </td>",
"       <td>",
"        150 to 200 mg/m2 daily for five days",
"       </td>",
"       <td>",
"        Every 4 weeks",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\" rowspan=\"2\">",
"        Adjuvant temozolomide [4]",
"       </td>",
"       <td>",
"        75 mg/m2 daily during RT",
"       </td>",
"       <td colspan=\"1\" rowspan=\"2\">",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Up to six cycles of 150 to 200",
"mg/m2 daily for 5 days, every 28 days",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Adjuvant temozolomide [5]",
"       </td>",
"       <td>",
"        50 mg/m2 daily during RT only",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     1. Medical Research Council trial. J Clin Oncol 2001; 19:509.",
"     <br>",
"      2. Levin, VA, et al. Int J Radiat Oncol Biol Phys 1990; 18:321.",
"      <br>",
"       3. van den Bent, MJ, et al. Neurology 1998; 51:1140.",
"       <br>",
"        4. Stupp, R, et al. N Engl J Med 2005; 352:987.",
"        <br>",
"         5. Combs, SE, et al. Proc Am Soc Clin Oncol 2004; 23:114a.",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
